import React from 'react';
import SquareButton from './SquareButton'
import './App.css';
import Selector from "./selector"


function App() {

  let position = 0;

  let squareOne = <SquareButton color="goldenrod"></SquareButton>
  let squareTwo= <SquareButton color="red"></SquareButton>
  let squareThree = <SquareButton color= "slategrey"></SquareButton>
  let squareFour  = <SquareButton color = "darkcyan"></SquareButton>

  squareOne.state(
    {
      color: "goldenrod"

    }
  )

  squareTwo.state(
    {
      color: "red"

    }
  )

  squareThree.state(
    {
      color: "slategrey"

    }
  )



  return(
    <div id = "overAll">
      <div id = "contentA">
        <div id = "buttonBlock">
          {squareOne}
          {squareTwo}
          {squareThree}
          {squareFour}
        </div>
      </div>
      <div id = "contentB">
        <div id = "selectorblock">
          < Selector position = {position} squareOne = {squareOne} squareTwo = {squareTwo} squareThree = {squareThree} squareFour = {squareFour}>  </Selector>
        </div>
      </div>
  </div>
  );
}

export default App;
